import React, { useState } from 'react';

function Todoapp() {

    const [input, setInput] = useState();

    const updateinput = (e) => {
        setInput()
    }

    return (
        <>
            <div className='todo-app'>
                <form >
                    <input onChange={updateinput} type="text" />
                    <button type='submit'>submit</button>
                </form>
            </div>
            <div className='items-list'>

            </div>
        </>
    );
}

export default Todoapp;
